import React from "react";
import twbb from "../images/there-will-be-blood.jpg"
import { useNavigate } from "react-router-dom";
import "../stylesheets/MovieCard.css";

export default function MovieCard() {
    const navigate = useNavigate();

    const navigateToMovie = () => {
        // üëáÔ∏è navigate to /contacts
        navigate('/there-will-be-blood');
    };

    return (
        <div className="movie-card" onClick={navigateToMovie}>
            <img src={twbb} alt="there will be blood" className="poster" />
            <div className="release-date">Released Jul 5, 2022</div>
            <div className="movie-name">There will be blood</div>
            <div className="movie-director">Paul Thomas Anderson</div>
        </div>
    );
}
